We haven’t quite been waiting 100 years for an Avatar game that lives up to the potential of the show, but it’s certainly beginning to feel that way after playing Avatar: The Last Airbender - Quest for Balance. This half-baked and wildly inconsistent retelling of the excellent TV series shows the promise of what an Avatar game could maybe be, but a baffling choice of which scenes to highlight, a clunky camera and combat, hilarious balance problems, and an overreliance on middling block puzzles and boring fetch quests leaves our search for the real Avatar still desperately out of luck. With more Avatar shows and movies on the way, it’s just downright odd how Quest for Balance has managed to arrive at this point in time as both an unsatisfying entry point for newcomers and a poor way to revisit it for dedicated fans.

