Shadow Gambit: The Cursed Crew is a peak example of the stealth tactics genre from a studio that is clearly mastering its craft. Its mission structure is spread across excellently entertaining levels with rich detail to find and master, while characters shine with voice performances, endearing humor, and colorful art that both delight and impress. With innumerable ways to approach its levels and an extremely smart integration of the practice of saving and reloading into the world’s fiction, it’s firing on all cylinders in all categories except perhaps enemy AI. Frankly, I don't know anyone I wouldn't recommend it to.

