It’s astounding to think that if I were to create a list of my favorite soulslikes, my favorite looter shooters, and my favorite procedurally generated games, Remnant 2 would appear on all of those lists. This is a triumphant sequel that doesn’t just reimagine the soulslike genre as a co-op looter-shooter, but absolutely nails that concept in nearly every way – including many that the original did not. With completely engrossing combat, challenging and memorable boss fights, ultra-dense buildcrafting options, incredibly cool procedurally generated levels, and a clever multiversal concept that allows for a ton of different adventures in one package, it’s very likely going to become one of my most-played games this year. No matter which part of the multiverse you find yourself in, you should do yourself a favor and play this gem.

