Trepang2 is a delightful tribute shooter that brings the relentless yet intelligent and often creative action of games like F.E.A.R. to the modern standards of 2023. Its diverse enemy encounters and smart level design are top-notch, though it’s less successful when it occasionally dips into lukewarm survival-horror elements, and that’s when it becomes apparent that it could’ve really used a stronger story and better scares. In light of that, it’s wise that it leans harder on action than stealth throughout, often keeping pace with the best first-person shooters when firefights heat up. However, it still ends a bit more quickly than I’d have hoped, even after padding out its length in higher difficulty modes and side missions. Trepang2 feels like a strong prototype for a Trepang3 that pairs this great action with a less paint-by-numbers story and an extended campaign, but in the meantime, I’ll happily go back in and play it all over again with the myriad cheats I’ve already unlocked.

