With nicely redone graphics and excellent music bringing the classic turn-based tactical action up to modern standards, Advance Wars 1+2: Re-Boot Camp is a great return for this long-neglected series and gives me hope for a follow-up that includes the DS games. While there isn’t much variety in the game modes, Advance Wars’ depth comes from the number of variables you can adjust to make every match feel unique. The biggest miss is the lack of multiplayer matchmaking, which makes it harder to get into a game than it ought to be in 2023, but at least you can play online. Playing against the AI will keep me interested in the short term, but I predict the inability to play against random opponents online will limit my spontaneous play sessions. However, the sheer number of maps, playable COs, and options for each match means that when I do, it's sure to be a unique experience.

