"Crime Boss: Rockay City is an overly ambitious air ball on all fronts, from its sloppy moment-to-moment gameplay to its largely abysmal voice acting – the worst of which sound like single takes spliced in with mistakes intact. There’s an earnestness with which Crime Boss has been put together that I do admire – as a kind of direct-to-VHS knockoff of Payday on a promising ’90s backdrop – and there is an inescapable novelty in seeing these de-aged Hollywood stars steering the story here. Unfortunately, the hokey charm on display is nowhere near enough to offset the repetitive and regularly frustrating mission design, its roguelike single-player rapidly becomes a total chore, and its co-op juice just isn’t worth the squeeze. Sadly, Crime Boss: Rockay City’s coked-up ego has been writing cheques its budget-priced body couldn’t cash."

