"This ingenious blend of RPG mechanics, visual novel-style storytelling, and deck-building roguelike gameplay is a beautiful recipe for a kind of game I never knew I wanted.\xa0 Even though I've already spent the past week getting through each of Griftlands' campaigns multiple times, I'm still looking forward to my next run - and the run after that. Campaigns are short and challenging, making them highly replayable and memorable adventures that reward your time. It's kinda absurd that such an eclectic group of mechanics work together in such harmony, but once you're bitten by their charms it's quite hard to put Griftlands down."

