"Alicization Lycoris feels like an amalgamation of ideas for Sword Art Online games of different genres without much thought given to how they can combine together, and the seams are showing. It definitely had potential, but squandered the majority of it on a lackluster retelling of the anime's story that leaves out interesting parts in favor of extended boring conversations, locking out co-op and character customization for the first half, and a litany of performance problems. The exciting combat and interesting characters aren't enough to save this action-RPG from being just another disappointing footnote in this anime's legacy."

