"Everyone has their shortlist of favorite food and drinks. You might like pizza, steak, red velvet cake, and chamomile tea. But you would never want to dump all of that onto one plate, mash it all together, and then expect it to taste as good as they all do separately. And that disgusting mess of an analogy is what Waking tries to do but for game genres; take some from Dark Souls, some from various walking simulators, a little from Silent Hill: Shattered Memories, maybe a dash of Psychonauts, and definitely a healthy serving of roguelike. None of it works together, with each piece clashing with every other in the worst way possible."

