"There's not much to Little Orpheus's gameplay apart from moving left to right, jumping, and interacting with a few objects, but that's compensated by stellar voice acting and gorgeous settings to journey through. You'll find some light puzzles and platforming challenges here, but this is an interactive story above all else - and that's not a knock against it. Some repetition settles in by the end, unfortunately, and you'll see some minor frame rate drops even on a brand new-iPhone. But for the first time in months, Apple Arcade has justified its $4.99 subscription cost with a game well worth playing."

